const milisec_to_date = (date, count_video) => {
  // let endDay = new Date(date + 84600 * 2 * 1000);
  // console.log(endDay, "end");

  const startDay = new Date(date);

  const today = new Date(Date.now());

  const period = (count_video / 3) * 7;

  const endDay = new Date(Date(date) + 86400 * 1000 * period);
  console.log(endDay, "endDay");

  if (startDay - today > 0) {
    console.log("khoa hoc chua bat dau");
  } else if (startDay < today < endDay) {
    console.log("khoa hoc dang dien ra");
    let rate = (today - startDay) / (endDay - startDay);
    return rate;
  } else if (endDay - today < 0) {
    console.log("khoa hoc da ket thuc");
  }

  // 1 chua bat dau khoa hoc  startDay > toDay
  // 2 dang trong khoa hoc   startDay < today < endDay
  // 3 ket thuc khoa hoc      endDay < to day
};

export default milisec_to_date;
